import React, { useState } from "react";

function App() {

    const [phones, setPhones] = useState([]);
    const [model, setModel] = useState("");
    const [price, setPrice] = useState(0);

    function AddPhone() {
        setPhones(phones.push({id: phones.length, model: model, price: price}));
        setModel("");
        setPrice("");
    }

    return (
        <div>
            <div>
                <input
                    value={model}
                    onChange={event => setModel(event.target.value)} 
                    type="text" 
                    placeholder="Phone model"
                    />
                <input
                    value={price}
                    onChange={event => setPrice(event.target.value)} 
                    type="number"
                    />
                <button onClick={AddPhone}>Add phones</button>
            </div>
            <div>
                <h3>Phones</h3>
                {console.log(phones)}
            </div>
        </div>
    );
}

export default App;
